def restore_prime_order(a):
    primes = [x for x in a if is_prime(x)]
    primes.sort()
    result = []
    prime_index = 0
    for x in a:
        if is_prime(x):
            result.append(primes[prime_index])
            prime_index += 1
        else:
            result.append(x)
    return result
